var imageController=function(){var n=function(n){$(document).ready(function(){$(".js-property-item").on("click",function(){$(this).siblings().removeClass("active");$(this).addClass("active");$.ajax({url:n+"/"+this.id,success:function(n){document.getElementById("js-property-image").src="data:image/png;base64,"+n}})})})};return{init:n}}();